import classes from './AvailableMeals.module.css';
import Card from '../UI/card';

const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Milanesa Napolitana',
        description: 'Milanesa de carne con salsa de tomate con albahaca, orégano, jamón y queso. Acompañada con porcion de papas fritas',
        price: 3.500,
    },
    {
        id: 'm2',
        name: 'Ravioles con salsa de champignones',
        description: 'Ravioles caseros rellenos con verdura, con salsa de crema, verdeo y champignones',
        price: 4.000,
    },
    {
        id: 'm3',
        name: 'Lasagna',
        description: 'Lasagna con picada, jamón y queso.',
        price: 3.000,
    },
    {
        id: 'm4',
        name: 'Godly ensalada',
        description: 'Tomates cherris, lechuga, zanahoria, cebolla de verdeo, rúcula, pan tostado, queso, queso roquefort y aceite de oliva',
        price: 2.500,
    },
];

const AvailableMeals = () => {
    const mealsList = DUMMY_MEALS.map(meal => <li>{meal.name}</li>);

    return <section className={classes.meals}>
        <Card>
        <ul>
            {mealsList}
        </ul>
        </Card>
    </section>
};

export default AvailableMeals;
